import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="bg-gradient-to-r from-blue-600 to-indigo-700 p-4 shadow-lg">
      <div className="container mx-auto flex justify-between items-center">
        <Link to="/" className="text-white text-3xl font-extrabold tracking-wide">
          NeuroAssess
        </Link>
        <span className="text-blue-100 text-lg font-light hidden sm:block">
          Advanced Early Alzheimer's Detection Platform
        </span>
      </div>
    </nav>
  );
};

export default Navbar;
